import React from 'react'
import './Join.css'

const Join = () => {
    return (
        <div className='join-container'>
          <div className='join-header mb-3'>Join</div>
          <div><input type='text' placeholder='Name'></input></div>
          <div><input type='text' placeholder='Room'></input></div>
          <button type='submit' className='btn btn-block btn-primary mt-3'>SUBMIT</button>
        </div>
    )
}

export default Join;
